import React, { useState } from 'react';
import { View,
    Text,
    TextInput,
    TouchableOpacity,
    StyleSheet,
    Image, } from 'react-native';
import { StatusBar } from "expo-status-bar";

export default function SignUp() {

  const [email, setEmail] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [password, setPassword] = useState('');

  
  const handleSignUp = () => {
    // Perform sign up logic here, such as sending a request to your backend server
    // to create a new user account with the provided email and password
    // You can also add some validation here like checking the passwords match.
  };


  return (
    <View style={styles.container}>   
  
    <StatusBar style="auto" />
    <Image style={styles.image} source={require("../../../assets/logo.png")} />
   
   
    <View>
      <Text style={styles.text}>First Name:</Text>
        
      </View>
   
    <View style={styles.inputView}>
    
      <TextInput
        style={styles.Textinput}
        placeholder="FirstName"
        value={firstName}
        onChangeText={(text) => setFirstName(text)}
      />
      </View>
      <View>
      <Text style={styles.text}>last Name:</Text>
        
      </View>
      <View style={styles.inputView}>
     
      <TextInput
        style={styles.Textinput}
        placeholder="lastName"
          
        value={lastName}
        onChangeText={(text) => setLastName(text)}
      />
    
      </View>
      


    <View style={styles.inputView}>
    <Text style={styles.text}>Email:</Text>
      <TextInput
        style={styles.Textinput}
        placeholder="Enter your email address "
        value={email}
        onChangeText={(text) => setEmail(text)}
      />
      </View>
      <View>
      <Text style={styles.text
      }>Password</Text>
        
      </View>
      <View style={styles.inputView}>
      <TextInput
        style={styles.Textinput}
        placeholder=" Enter your password"
        value={password}
        secureTextEntry={true}
        onChangeText={text => setPassword(text)}
      />
      
       </View>

      

      <TouchableOpacity
        style={styles.button}
        onPress={handleSignUp}
      >
        <Text style={styles.buttonText}>Signup</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
 
    flex: 1,
    backgroundColor: "white",
    alignItems: "center",
    justifyContent: "center",
  },
  inputView: {
    backgroundColor: "#F5f5f5",
    borderRadius: 30,
    width: "70%",
    height: 45,
    marginBottom: 20,
    alignItems: "center",
  },
 

  Textinput: {
    height: 50,
    flex: 1,
    padding: 10,
    marginLeft: 20,
    color:"grey",
  },
  image: {
    marginBottom: 40,
    width: 100, height: 100,
  },
  button: {
    width: "80%",
    borderRadius: 25,
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 40,
    backgroundColor: "#4a1259",
  },
  buttonText: {
    color: '#fff',
    fontWeight: 'bold',
  },
  text:{
    
    marginTop: 20,
    fontFamily: 'Avenir-Heavy',},
    alignItems: left


});
